import React, { useRef } from 'react';
import { Canvas, useThree } from '@react-three/fiber';
import { useGLTF } from '@react-three/drei';

export function useOutline(obj, outlineProps = {}) {
    const ref = useRef()
    useFrame(({ gl, scene, camera }) => {
      if (ref.current) {
        const selectedObjects = obj
          ? Array.isArray(obj)
            ? obj.map(o => scene.getObjectByName(o))
            : scene.getObjectByName(obj)
          : scene.children
        selectedObjects
          .filter(obj => obj)
          .forEach(obj => {
            const selectedMaterial = obj.material
            if (!selectedMaterial.isShaderMaterial) {
              const outlineMaterial = selectedMaterial.clone()
              outlineMaterial.skinning = selectedMaterial.skinning
              outlineMaterial.morphTargets = selectedMaterial.morphTargets
              outlineMaterial.morphNormals = selectedMaterial.morphNormals
              outlineMaterial.side = THREE.BackSide
              outlineMaterial.transparent = true
              outlineMaterial.opacity = outlineProps.opacity || 1
              outlineMaterial.color = outlineProps.color || new THREE.Color(0xffffff)
              outlineMaterial.emissive = outlineProps.emissive || new THREE.Color(0x000000)
              outlineMaterial.emissiveIntensity = outlineProps.emissiveIntensity || 1
              outlineMaterial.emissiveColor = outlineProps.emissiveColor || new THREE.Color(0x000000)
              outlineMaterial.polygonOffset = true
              outlineMaterial.polygonOffsetFactor = -4
              outlineMaterial.wireframe = true
              obj.material = [selectedMaterial, outlineMaterial]
              obj.onBeforeRender = function (renderer) {
                renderer.clearDepth()
              }
              obj.__outline = true
            }
          })
      }
    })
    return ref
  }

const shapes = require("../../assets/3dModels/backgroundShapes.gltf");
const objectsToOutline = ["Cube", "Cube001", "Roundcube", "Cube002", "Cube003", "Cube004", "Cube005", "Roundcube001", "Roundcube002"];

function Model(props) {
  const { nodes, materials } = useGLTF(shapes);
  const ref = useRef();
  useOutline(ref, { visible: true, edgeStrength: 3, edgeGlow: 0, edgeThickness: 1, pulseSpeed: 0, edgeColor: 0x000000 });

  return (
    <group ref={ref} {...props} dispose={null}>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube.geometry}
        material={materials["Material.002"]}
        position={[-1.59, 0.8, -0.09]}
        rotation={[-0.26, 0.43, 0.58]}
        scale={0.27}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube001.geometry}
        material={materials["Material.003"]}
        position={[1.68, 0.22, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
        scale={0.26}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Roundcube.geometry}
        material={materials["Material.003"]}
        position={[-0.67, -0.78, 0]}
        scale={0.28}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube002.geometry}
        material={materials["Material.005"]}
        position={[-0.96, -0.59, -0.72]}
        rotation={[-0.31, 0.09, 0.68]}
        scale={[0.63, 0.09, 0.11]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube003.geometry}
        material={materials["Material.003"]}
        position={[-2.08, 0.7, -0.49]}
        rotation={[-0.27, 0.44, 0.58]}
        scale={0.27}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube004.geometry}
        material={materials["Material.005"]}
        position={[0.23, 0.5, -0.28]}
        rotation={[2.28, -0.63, 2.04]}
        scale={0.18}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Cube005.geometry}
        material={materials["Material.004"]}
        position={[0.4, 0.85, -0.12]}
        rotation={[2.28, -0.63, 2.04]}
        scale={0.18}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Roundcube001.geometry}
        material={materials["Material.004"]}
        position={[0.72, -0.35, 0]}
        scale={0.5}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.Roundcube002.geometry}
        material={materials["Material.002"]}
        position={[0.6, -0.35, -1.04]}
        scale={0.6}
      />
    </group>
  );
}

useGLTF.preload(shapes);

export default function BackgroundShapes() {

    return <div style={{ zIndex: "-1", position: "fixed", height: "100dvh", width: "100dvw", border: "2px solid red", pointerEvents: "none" }}>
        <Canvas>
            <ambientLight />
            <pointLight position={[5, 5, 5]} />
            <Model />
        </Canvas>
    </div >
}
